export const getNameFile = (nameFile: any) => {
  let getLast = nameFile.split(".").slice(-1)[0];
  switch (getLast.toLowerCase()) {
    case "docx":
      let doc =
        "data:image/jpeg;base64,";
      return doc;
    case "pdf":
      let pdf =
        "data:image/png;base64,";
      return pdf;
    case "xlsx":
      let xlsx =
        "data:image/png;base64,";
      return xlsx;
    case "png":
      let png = "";
      return png;
    case "zip":
      let zip =
        "data:image/jpeg;base64,";
      return zip;
    case "jpg":
      let jpg = "";
      return jpg;
    case "rar":
      let rar = "";
      return rar;
    case "txt":
      let txt =
        "data:image/png;base64,";
      return txt;
    case "xml":
      let xml = "";
      return xml;
    case "gif":
      let gif = "";
      return gif;
    default:
      doc = "";
      break;
  }
};
